You can now infer a TypeScript type alias using the exported InferType. Given the following Yup schema:import * as yup from 'yup';

const personSchema = yup.object({
  firstName: yup
    .string(),
  nickName: yup
    .string()
    .nullable(),
  gender: yup
    .mixed<'male' | 'female' | 'other'>()
    .oneOf(['male', 'female', 'other']),
  email: yup
    .string()
    .nullable()
    .notRequired()
    .email(),
  birthDate: yup
    .date()
    .nullable()
    .notRequired()
    .min(new Date(1900, 0, 1)),
});
You can derive the TypeScript type as follows:type Person = yup.InferType<typeof personSchema>;
Which is equivalent to the following TypeScript type alias:type Person = {
  firstName: string;
  nickName: string | null;
  gender: "male" | "female" | "other";
  email?: string | null | undefined;
  birthDate?: Date | null | undefined;
}
